import React, { Component } from 'react'
import { Link } from 'react-router-dom'
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import { makeStyles } from '@material-ui/core/styles';
import { Card, Container } from '@material-ui/core';
import 'emoji-mart/css/emoji-mart.css'
import { Picker } from 'emoji-mart'
import MainNavbar from './MainNavbar';
import { mergeClasses } from '@material-ui/styles';


class ColorPaletteList extends Component {


    render() {
    
        return(
            <Container>
       
            <Grid container justify="center" spacing={3} className="ColorPaletteList">
                <MainNavbar />
                <Grid item xs={12}>
                    <Grid container justify="center" spacing={5}>
            
                        {this.props.colorPalettes.map(palette => (
                             <Grid item xs={4}>
                                <Grid key={palette.id} item style={{border: "1px solid gray"}}>
                                
                                    {
                                        palette.colors.map(color =>(
                                            <div key ={color.color} style={{backgroundColor: color.color, height:"50px", width: "50px", display: "inline-block", margin: "0"}}>
                                            </div>
                                        ))
                                    } 
                                    <Link to = {`/palette/${palette.id}`}>{palette.paletteName}</Link> 
                                    <div>{palette.emoji}</div>
                                </Grid> 
                            </Grid>             
                        
                        ))}
                    </Grid>
                </Grid>
                {/* <Picker set='emojione' /> */}
                {/* <Picker onSelect={this.addEmoji} />
                <Picker title='Pick your emoji…' emoji='point_up' />
                <Picker style={{ position: 'absolute', bottom: '20px', right: '20px' }} /> */}
                {/* <Picker i18n={{ search: 'Recherche', categories: { search: 'Résultats de recherche', recent: 'Récents' } }} /> */}
            </Grid>
            </Container>
        )
    }
}

export default ColorPaletteList;
